import * as React from 'react';
import { Text, View } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { Icon } from 'react-native-elements'
import MapScreen from './MapScreen';

function Home() {
  return (
      <MapScreen/>
  );
}

function Wallet() {
  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <Text>Wallet!</Text>
    </View>
  );
}

function Cars() {
  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <Text>Cars!</Text>
    </View>
  );
}

function Settings() {
    return (
      <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
        <Text>Settings!</Text>
      </View>
    );
}

const Tab = createBottomTabNavigator();

function MyTabs() {
  return (
    <Tab.Navigator
      initialRouteName="Home"
      screenOptions={{
        tabBarActiveTintColor: '#004643',
      }}
    >
      <Tab.Screen 
        name="Home"
        component={Home}
        options={{
          tabBarLabel: 'Home',
          tabBarIcon: ({ color, size }) => (
            <Icon name='home' type='font-awesome' color= '#004643' />
          ),
        }}
      />
      <Tab.Screen
        name="Cars"
        component={Cars}
        options={{
          tabBarLabel: 'Cars',
          tabBarIcon: ({ color, size }) => (
            <Icon name='car' type='font-awesome' color= '#abd1c6' />
          ),
        }}
      />
      <Tab.Screen
        name="Wallet"
        component={Wallet}
        options={{
          tabBarLabel: 'Wallet',
          tabBarIcon: ({ color, size }) => (
            <Icon name='money' type='font-awesome' color= '#abd1c6' /> 
          ),
        }}
      />
    <Tab.Screen
        name="Settings"
        component={Settings}
        options={{
          tabBarLabel: 'Settings',
          tabBarIcon: ({ color, size }) => (
            <Icon name='gear' type='font-awesome' color= '#abd1c6' />
          ),
        }}
      />
    </Tab.Navigator>
  );
}

export default function Location2({ navigation }) {
  return (
    <NavigationContainer independent={true}>
      <MyTabs/>
    </NavigationContainer>
  );
}
